Qui sommes-nous ?
Avec 90 000 collaborateurs présents sur les cinq continents, SUEZ est un leader mondial dans la gestion intelligente et durable des ressources. Le Groupe fournit des solutions de gestion de l'eau et des déchets qui permettent aux villes et aux industries d’optimiser la gestion de leurs ressources et d’améliorer leurs performances environnementale et économique.

SUEZ Consulting, Business Unit du groupe SUEZ, propose des solutions innovantes de conseil et d’ingénierie qui intègrent l’ensemble des dimensions techniques, économiques, environnementales et sociales. Nos talents interviennent en conseil, maîtrise d’œuvre, optimisation des investissements, gestion de projets complexes, dans les secteurs de l’environnement, de la ville et de l’énergie.
Votre profil
Diplômé(e) d’une formation supérieure et au moins une première expérience (2 ans minimum) en tant que Product Owner au sein d’une équipe agile.
Petit plus si tu as des connaissances en SEO.
Qualités recherchées
Tu maîtrises l’agile, et ton expérience parle d’elle-même ;
Tu fais preuve d’un très bon relationnel, de sens de l’écoute et de l’empathie, et d’un goût pour le travail en équipe, avec des profils techniques et non-techniques ;
Tu as l’esprit d’initiative et tu es naturellement force de proposition (vision produit, fonctionnalités, méthodes, outils…) ;
Tu es rigoureux/se, dispose d’un esprit de synthèse, et ton approche est orientée résultat ;
Et bien sûr tu disposes d’une culture digitale, tu es curieux/se, créatif/ve, impliqué(e) et passionné(e) pour les nouvelles technologies…
Votre mission
SUEZ Consulting (entité du groupe SUEZ) propose des solutions innovantes de conseil et d'ingénierie qui intègrent l'ensemble des dimensions techniques, économiques, environnementales et sociales. Elle s’est doté il y a deux ans d’un Pôle Digital, affirmant ainsi son positionnement d’acteur de l’ingénierie de demain. La création de ce pôle apporte à SUEZ Consulting la maîtrise des technologies du numérique, et lui permet d’assurer la transformation digitale de ses offres. Le pôle digital met ainsi ses compétences au support d’activités de conseils stratégiques des métiers historiques de l’environnement (eau, énergie, déchets), mais adresse également les nouveaux marchés émergents (ville durable et intelligente, changement climatique, performance énergétique et environnementale, finance verte).
Dans le cadre de son développement, le Pôle Digital recherche un(e) Product Owner (H/F).
Dans le cadre de ce poste, tu participeras à la construction et l’amélioration de produits sur des applications à forts enjeux business (majoritairement web) – le tout dans une approche centrée « Utilisateurs ».
Tu identifieras les besoins du groupe ou de clients externes afin de proposer des solutions numériques ou de design, en prenant part active aux débats sur la stratégie produit et en cadrant l’expression des besoins ;
Tu partageras la vision projet avec l’équipe technique (design et développement), construiras les offres sur les aspects organisationnels, budgétaires et transverses (planning, storyboard, priorisation…) ;
Tu prendras part à la rédaction des user stories, t’assureras de la cohérence du backlog, et le mettra à jour, en aidant le client à prioriser ;
Tu assureras le lien entre les différents intervenants des projets, en prenant part aux rituels agiles, animeras les ateliers de lancement de projets avec nos clients, et assureras les recettes fonctionnelles avant d’accompagner les clients dans la prise en main de leurs solutions ;
Et enfin, tu participeras à l’analyse de metrics et à la formalisation de recommandations.

Pourquoi nous ?
Le pôle digital c’est :

Une activité digitale en pleine croissance dans le secteur du conseil, avec des développeurs web full stack, consultant design UX/UI, et consultants en stratégie digitale ;
Des thématiques autour de la protection de nos ressources naturelles, et de sujets de demain : ville durable et résiliente, finance carbone, climat, performance énergétique… ;
Une équipe agiliste, enjouée, souriante et dynamique de digital-natives passionnés par les nouvelles technologies et nouvelles méthodes de travail collaboratif ;
Une diversité de profils au sein de l’équipe (ingénieurs, commerciaux, reconversions…) et d’expériences passées (agence web, commercial, conseil…) ;
Un cadre agréable dans un open-space tout neuf ;
Possibilité d’évoluer rapidement et de prendre des responsabilités ;
Un environnement challengeant, tu ne t’ennuieras pas au Pôle Digital !

Description de l'entreprise
Agence pure player e-commerce crée en 2003, pionnière dans l'intégration SAAS E-commerce, nous accompagnons les marques et les distributeurs dans leur transformation durable au travers d'une offre "full services" combinant plateforme e-commerce, omnicanalité, data marketing, in-store et solutions d'engagement clients. Notre culture digitale façonne notre identifé et nos succès. Nous avons rejoint la famille Capgemini en 2017 avec pour objectifs d'accélérer notre croissance et d'apporter aux clients du groupe notre expertise e-commerce. ITELIOS à rejoint le palmares Great Place To Work depuis 2016 dans la catégorie des entreprises de moins de 500 salariés, et nous en sommes très fiers !
Description du poste
Rattaché(e) à un Chef de projet technico-fonctionnel, vous occupez le rôle de Technical Lead sur un projet pour un ou plusieurs comptes de la practice e-commerce et omnicanal de l'agence.
Au sein de l’équipe, vous êtes le leader technique et le manager d'une équipe d'ingénieurs Back end et Front End sur l’une des plateformes e-commerce en Build ou en TMA (Salesforce Commerce B2C et B2B, Adobe Magento et solutions de Headless Commerce) déployées avec nos clients (forfait et assistance technique).
Vos missions principales consistent à :
Participer vous-même activement au développement de parties du programme, déployer les bonnes pratiques de développeur, résoudre les problèmes, faire monter en compétences tous les membres de l’équipe ;
Manager l’équipe, apporter support et conseils techniques à vos co-équipiers : vous vous assurez qu’ils comprennent parfaitement l’architecture qu’ils implémentent, qu’ils utilisent correctement les outils et environnements mis à leur disposition ;
Participer aux actions de formation des équipes de Développeurs en France et en Neashore au Maroc (déplacements ponctuels de 2 ou 3 jours) ;
Organiser périodiquement des activités type revue de code ou pair programming pour améliorer continuellement la performance collective ;
Définir les actions de refactoring, créer, consolider, maintenir la bibliothèque de composants ;
Garantir la tenue de charge de la plateforme et sa sécurité ;
Recueillir les exigences d’architectures que vous êtes chargé de mettre en œuvre dans votre équipe ;
Remonter du feedback à l'architecte sur les difficultés rencontrées ou les suggestions d’amélioration, et s’assurer du respect de la bonne progression des développements et des délais ;
Accompagner le Chef de projet technico-fonctionnel dans la relation client, le conseil et la mise en œuvre technique de votre expertise.
Les clients qui nous font confiance : GIVENCHY, KENZO, LACOSTE, SANDRO MAJE CLAUDIE PIERLOT, KERING, CHANEL, PIMKIE, JENNYFER, JULES, BRICE, UNDIZ…
Qualifications
BAC + 4/5 en Engineering, vous avez 4 ans d'expérience minimum dans le développement d'applications back end et front end incluant le management d’une équipe d’ingénieurs dans des contextes variés (domaine fonctionnel, technos, type de projet de plateformes digitales et/ou e-commerce). Si vous êtes full stack c’est un plus..
Vous êtes familier de ces technos :
Maîtrise de deux langages de développement parmi Java J2EE, .NET, PHP ou Nodejs ;
Maîtrise des standards HTML5 et CSS3 ;
Framework web : Langage JavaScript (ECMAScript6+) au travers des Framework JavaScript (Angular JS, React JS, Backbone..),
Automatisation de build : Maven, Gulp, Grunt.
Framework de déploiement applicatif : Connaissance de Jenkins, Travis CI, CircleCI ou Docker.
Interface de description du langage d’un web services : WADL, WSDL
Langage de commande : SSH, Bash, RDP, Powershell, CMD
Protocole de sécurité : SAML, SSO, OpenID Connect, Oauth
Bases de données : maîtrise d'une base de données relationnelles (SQL Server, Oracle, MySQL), ET orientée documents (MongoDB, ElasticSearch, CouchDB)
Framework de tests unitaires : Mocha, Jasmine.
Connaître l’administration serveur : Linux, Windows.
Vous vous maîtriser le chiffrage d’un projet et vous avez déjà compris les bienfaits de l’agilité (Scrum, Kanban…) dans votre métier.

Vous vous intéressez à toutes les facettes de votre métier d’ingénieur : architecture, conception, développement, méthodes, travail en équipe, enjeux business des projets auxquels vous participez.
Vous êtes avant tout un manager avec un focus technologique et vous n’envisagez pas un instant de lâcher le clavier ni l'encadrement d'équipes techniques.
Vous êtes continuellement en veille avec la curiosité comme moteur principal avec une forte sensibilité pour les challenges techniques et UI/UX de l’e-commerce.
Vous êtes anglais fluent (clients internationaux et équipes ITELIOS internationales).
Informations complémentaires
Process de recrutement en 3 étapes :
Présélection et entretien avec notre équipe Talent Acquisition ;
Passage d'un test technique sur le developpement web ;
Entretien avec un de nos Technical Leads.

Vos missions, si vous les acceptez :
Cerner le besoin client et ses spécificités techniques ;
Proposer les technologies ou Frameworks les plus adaptés ;
Participer aux développements backend et frontend ;
Veiller à la qualité de votre code (longue vie au code propre et aux tests !) ;
Travailler en squad (agilité, qualité de code, performance, DevOps, etc.) ;
Partager et développer vos connaissances (veille, pair programming, rayonnement par des conférences, partage des compétences, etc.) ;
Innover et innover encore.
Pour accomplir vos missions, voici les compétences clés :
Vous êtes passionné par le code ;
Vous connaissez le langage JavaScript sur le bout des doigts ;
L’Atomic Design est un prérequis pour vous ;
Les applications avec Redux / React ou Vue n’ont plus de secret pour vous ;
Vous avez déjà utilisé la technologie Node.js pour créer des API Rest ou GraphQL ;
Vous commencez à vous intéresser à des technos en langage fonctionnel comme ELM ou PureScript ;
Vous êtes sensible au Software Craftsmanship, à l’Agilité et au DevOps.
Nous recherchons avant tout quelqu’un de curieux, plein d’initiatives, qui a envie de partager sa passion. Le sens de l’humour et de l’auto-dérision sont un plus non négligeable !

Talan Labs est spécialisée en technologies numériques et approches innovantes. Notre mission : créer de la valeur chez nos clients sans sacrifier la qualité tout en recherchant l’excellence !
Que fait Talan Labs ?
Talan Labs, c’est 12 Labs organisés autour de 2 piliers et un cœur :
Un pilier d’expertise technologie autour de la Blockchain, IA, Big Data, IOT et les technologies web.
Un pilier d’expertise méthodologique autour du Software Craftsmanship, DevOps, UX/UI Design, Legacy Remediation, et la transformation des entreprises vers des organisations agiles.
Un cœur, baptisé Digital Factory, qui s’appuie sur ces 2 piliers pour développer des applications web et mobiles.
Pourquoi Talan Labs ?
Talan Labs met ses collaborateurs au centre de son développement :
Un mentor pour accompagner chaque collaborateur ;
Un parcours de progression et de formation adapté à chacun ;
Des ateliers, dojos et katas pour le partage d’expérience et de compétences ;
Du temps accordé pour participer à des conférences, à des projets innersourcés, faire de la veille et rédiger des articles ;
Un accompagnement pour être speaker à des meet-ups ou talks ;
Du temps pour tous se retrouver et partager.

Dans le cadre du développement d'Actimage, nous recherchons un développeur Back-Office Drupal 8 sensibilisé au domaine du Digital. Dans un premier temps, vous interviendrez sur un projet web lié au métier de la culture et serez amené à participer aux différentes phases de son exécution en équipe. Vous serez en charge du développement de la partie Web du projet avec un chef de projet Digital, en interaction avec les équipes créatives. Vos missions seront notamment de :
Analyser et comprendre les besoins du client ;
Réaliser la définition de l'architecture et choix des technologies appropriées ;
Monter les environnements de développements ;
Rédiger des spécifications fonctionnelles et techniques ;
Participer aux phases de tests et recette.
Un profil Full Stack, avec une forte appétence pour tout l'univers du développement web, serait un plus pour de futurs projets :
Création de site internet ;
Développement de nouvelles fonctionnalités ;
Assister les clients dans la livraison et le déploiement des solutions.
Profil recherché
Vous avez suivi une formation d'excellence (BAC +5). Vous justifiez d'au moins 2 ans d'expérience dans le secteur informatique.
Vous avez une forte appétence pour les projets innovants et des bases solides en informatique.
Vous êtes passionné(e) par l'innovation et les nouvelles technologies et vous êtes en constante veille technologique.
Vous possédez les compétences nécessaires pour appréhender les technologies web et disposez de connaissances approfondies sur Drupal 8, que vous avez acquis avec des expériences.
Actimage dispose d'une structure de formation interne, l'Actimage Academy, vous bénéficiez d'un accès à l'ensemble du catalogue de formations pour parfaire vos compétences dans les domaines d'expertise technique, de gestion de projet, de management, ou de l'account management. Vous êtes également invité, si vous le souhaitez, à intervenir en tant que Formateur référent sur un domaine qui vous tient à cœur.

DESCRIPTION
Work is about doing something that matters and growing as we do it. That's why we've built HR software that can help make this happen. At Talentsoft our mission is to help everyone, from our people to our customers, experience work differently.

Each of our 600 Talentsoftees comes to work with an entrepreneurial spirit and the flexibility to try new things, work with innovative technologies, and build corporate-social responsibility directly into their jobs. The result is that we have 9 million people in 130 countries using our products, strong brand recognition in a fiercely competitive industry, and employees who work differently and love their jobs because of it.

