Les missions d'un .NET Developer chez Talentsoft ?

Tu participes au Stand Up Meetings et aux rétrospectives ;
Tu codes, tu codes, tu codes (et tu t'appliques hein !) avec ton binôme ;
Chez Talentsoft, tu trouveras un savoureux équilibre entre le refactoring et le développement de nouvelles fonctionnalités from scratch ;
Tu coaches les développeurs juniors, et tu montes en compétences au contact des développeurs seniors ;
Avec les développeurs des autres programmes, tu fais évoluer les bonnes pratiques (TDD, BDD, software Craftmanship, DevOps, DevSecOps, Pair Programming...) au sein des guildes auxquelles tu participes.
Et comme tous les jours sont différents chez Talentsoft, tu auras l'occasion de prendre part à d'autres missions : conception de widgets, développement d'API, automatisation des tests, ateliers-clients...

PROFILE

Talentsoft, c'est (tout) ça :
Un environnement Agile (SCRUM et Kanban), et la présence d'une équipe d'Agile Coachs qui fluidifie les process Agile ;
20% de freetime, et 1 jour par semaine de home office ;
Si tu n'es pas à Paris mais en France métropolitaine, tu peux travailler en full remote ;
Chez Talentsoft, tu évolues dans une Squad avec des développeurs, 1 QA, 1 Archi, 1 UX, 1 PO et un Program Manager : toutes les personnes avec lesquelles tu travailles sont à moins de 5 mètres de toi ;
2 stacks techniques : pour les outils d'E-learning : PHP / Symfony, et sur le Talent Management : C# .NET ;
Tu évolueras toujours sur les dernières versions des dernières technos ;
Et bien-sûr, les avantages Talentsoft : CE, mutuelle, babyfoot, ping-pong, barbecue, PlayStation (la 4 !), des équipes super motivées et passionnées !
